import React from "react";
import Card from "react-bootstrap/Card";

function Text() {
  return (
    <Card style={{ width: "100%" }}>
      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
        </Card.Text>
      </Card.Body>
    </Card>
  );
}

export default Text;
